import React from "react";
import styles from "./MainImage.module.css"

const MainImage = () => {
  return (
    <section>
      <div className={styles.main_image}>
        <h1 className={styles.title}>TeamTeaching</h1>
        <h3 className={styles.title}>TeamTeaching</h3>
      </div>
    </section>
  )
}

export default MainImage
